template<PieceType Pt>
static constexpr uint64_t attacks_bb(Square s, uint64_t occupied = 0ull)
{
	#if (DEBUG)
		assert(Pt != PAWN);
		assert(::is_ok(s));
	#endif
	if constexpr (Pt == ROOK)
		return ROOK_MAGICS[s][occupied];
	if constexpr (Pt == BISHOP)
		return BISHOP_MAGICS[s][occupied];
	if constexpr (Pt == QUEEN)
		return ROOK_MAGICS[s][occupied] | BISHOP_MAGICS[s][occupied];
	if constexpr (Pt == KNIGHT || Pt == KING)
		return PIECE_ATTACKS[Pt][s];
}

static constexpr uint64_t attacks_bb(PieceType pt, Square s, uint64_t occupied = 0ull)
{
	#if (DEBUG)
		assert(pt != PAWN);
		assert(::is_ok(s));
	#endif
	switch (pt)
	{
		case ROOK: return attacks_bb<ROOK>(s, occupied);
		case BISHOP: return attacks_bb<BISHOP>(s, occupied);
		case QUEEN: return attacks_bb<QUEEN>(s, occupied);
		default: return PIECE_ATTACKS[pt][s];
	}
}


template<Direction D>
static constexpr uint64_t shift(uint64_t bb)
{
	if constexpr (D == Direction::N)
		return bb << 8;
	if constexpr (D == Direction::S)
		return bb >> 8;
	if constexpr (D == Direction::NN)
		return bb << 16;
	if constexpr (D == Direction::SS)
		return bb >> 16;
	if constexpr (D == Direction::E)
		return (bb & ~Bitboard::FILEH) << 1;
	if constexpr (D == Direction::W)
		return (bb & ~Bitboard::FILEA) >> 1;
	if constexpr (D == Direction::NE)
		return (bb & ~Bitboard::FILEH) << 9;
	if constexpr (D == Direction::NW)
		return (bb & ~Bitboard::FILEA) << 7;
	if constexpr (D == Direction::SE)
		return (bb & ~Bitboard::FILEH) >> 7;
	if constexpr (D == Direction::SW)
		return (bb & ~Bitboard::FILEA) >> 9;
}

template<Color C>
consteval Direction pawn_step()
{
	if constexpr (C == WHITE)
		return Direction::N;
	else
		return Direction::S;
}

template<Color C>
consteval Direction pawn_push()
{
	if constexpr (C == WHITE)
		return Direction::NN;
	else
		return Direction::SS;
}

template<Color C>
consteval Direction pawn_atk_west()
{
	if constexpr (C == WHITE)
		return Direction::NW;
	else
		return Direction::SW;
}

template<Color C>
consteval Direction pawn_atk_east()
{
	if constexpr (C == WHITE)
		return Direction::NE;
	else
		return Direction::SE;
}

template<Color C>
static constexpr uint64_t pawn_step_bb(uint64_t bb)
{
	if constexpr (C == WHITE)
		return shift<N>(bb);
	else
		return shift<S>(bb);
}

template<Color C>
static constexpr uint64_t pawn_push_bb(uint64_t bb)
{
	if constexpr (C == WHITE)
		return shift<NN>(bb);
	else
		return shift<SS>(bb);
}

template<Color C>
static constexpr uint64_t pawn_atk_bb(uint64_t bb)
{
	if constexpr (C == WHITE) 
		return shift<NW>(bb) | shift<NE>(bb);
	else 
		return shift<SW>(bb) | shift<SE>(bb);
}

template<Color C>
static constexpr uint64_t pawn_atk_west_bb(uint64_t bb)
{
	if constexpr (C == WHITE)
		return shift<NW>(bb);
	else
		return shift<SW>(bb);
}

template<Color C>
static constexpr uint64_t pawn_atk_east_bb(uint64_t bb)
{
	if constexpr (C == WHITE)
		return shift<NE>(bb);
	else
		return shift<SE>(bb);
}


